import React from 'react';

const Table = ()=>{


    return (
        <tr>
            <td>{data.name}</td>
            <td>{data.id}</td>
            <td>{data.image}</td>
            <td>{data.symbol}</td>
            <td>{data.current_price}</td>
            <td>{data.total_volume}</td>
        </tr>
    )
}

export default Table;
